Unfiltered amber Bock. Bitterness 32 EBU.
            Amber colour with an even head; Liquorice, roast, toast and hop aroma; 
            sweetish/bitterish taste with caramel, raisin, liquorice and nuts; 
            sweetish/bitterish with toast, nuts, roast and hops.
            A pleasntly malty, nutty Bock.

Strong golden ale. Unfiltered. 
            Pale yellow colour, dense head; tobacco, basil, cloves and lemon aromas; 
            sweetish/bitter taste with grass, resin, chicory and fruit aromas; 
            very bitter finish with grass, resin, chicory and wood aromas.
            A beautifully hopped and decptively strong beer. Accounts for almost 
            75% of the brewery's output. (Tasted 20.07.05)
